// import Cookies from "js-cookie";
import React, { useState } from "react";
import { FiEye, FiEyeOff, FiPhone } from "react-icons/fi";
import { useNavigate } from "react-router-dom";
import api from "../../common/api/api";
const Login = () => {
  // const token = Cookies.get("zehinli_token");
  const [togglePassword, setTogglePassword] = useState(true);
  const handleToggle = () => setTogglePassword(!togglePassword);
  const navigate = useNavigate;
  const [login, setLogin] = useState({
    phone: "",
    password: "",
  });

  const onChangeHandler = (e: React.ChangeEvent<HTMLInputElement>) => {
    setLogin({ ...login, [e.target.name]: e.target.value });
  };

  const authLogin = (e: React.SyntheticEvent) => {
    e.preventDefault();
    api
      .get("/sanctum/csrf-cookie")
      .then((res) => {
        api.post("/auth/login", login).then((res) => {
          // Cookies.set("zehinli_token", res.data.token, { expires: 2 });
        });
      })

      .catch((error) => console.log(error));
  };
  return (
    <div className="flex justify-center items-center">
      {/* {token && <Navigate to="/" />} */}
      <form
        onSubmit={authLogin}
        action=""
        className=" bg-slate-50  p-6  mt-56 flex flex-col items-center rounded-3xl w-auto shadow-2xl"
      >
        <h1 className="text-cyan-900 font-black text-xl blur-none">
          Ulgama giriş
        </h1>
        <div className="flex items-center bg-none mt-4 border-b border-cyan-500 w-auto">
          <FiPhone size={24} className="ml-2 text-slate-600" />
          <input
            onChange={onChangeHandler}
            name="phone"
            type="text"
            placeholder="Tel"
            className="w-full bg-slate-50  p-3  focus:outline-none"
          />
        </div>
        <div className="flex items-center bg-none mt-4  border-b border-cyan-500 w-full">
          <button onClick={handleToggle} type="button">
            {togglePassword ? (
              <FiEye size={24} className="ml-2 text-slate-600" />
            ) : (
              <FiEyeOff size={24} className="ml-2 text-slate-600" />
            )}
          </button>
          <input
            onChange={onChangeHandler}
            name="password"
            type={togglePassword ? "password" : "text"}
            placeholder="Açar söz"
            className="w-full  p-3 bg-slate-50 rounded-xl focus:outline-none"
          />
        </div>
        <button
          type="submit"
          className="w-full bg-cyan-600 rounded-xl font-black text-xl mt-10 text-white p-3 text-center"
        >
          Tassyklaň
        </button>
      </form>
    </div>
  );
};

export default Login;
